Reorder XML .ui files to correct tab orders (#950)

* Reorder XML .ui files to correct tab orders

Affected files:
./lxqt-config-appearance/{gtkconfig.ui, fontsconfig.ui}
./lxqt-config-brightness/brightnesssettings.ui
./liblxqt-config-cursor/selectwnd.ui
./lxqt-config-input/{keyboardconfig.ui, touchpadconfig.ui}
./lxqt-config-monitor/{managesavedsettings.ui, monitorwidget.ui}

* Further fixes to XML .ui files

Don't return uninitialized struct member

At Result_moveMonitorPictureToNearest compareTwoMonitors()
with:
    if(monitorPicture1Rect.intersects(monitorPicture2Rect)) {
        result.ok = true;
        return result;
    }
result.outside is returned without initialization.
